"135897":{"id":"135897","name":"Nosso Eterno Verão","slug":"nosso-eterno-verao","original_title":"그 해 우리는","overview":"Uma comédia romântica sobre os complexos sentimentos sutis de dois homens e mulheres como amantes que se separam e são forçados a voltar para a frente das câmeras 10 anos depois devido à popularidade de um documentário que filmaram no ensino médio.","first_air_date":"2021-12-06","episode_run_time":60,"vote_average":8.4,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Lee Na-eun"],"production_companies":["Studio N","Big Ocean ENM","Supermoon Pictures"],"genres":["Comédia","Drama"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/4DGEmMg2BFmu4YqwGWvTcE353Ta.jpg","poster_path":"https://image.tmdb.org/t/p/original/8w44hUnFZIuK6plchcGzcW2mPU4.jpg","cast":["Woo-sik Choi","김다미","김성철","노정의","안동구"],"trailer":"N/A","seasons":{"0":{"name":"Especiais","poster_path":"https://image.tmdb.org/t/p/original/fukGX5x6QziLWLxsLDgzx8ecZhH.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/fukGX5x6QziLWLxsLDgzx8ecZhH.jpg","air_date":"2022-01-27","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2022-01-27","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/bNGMiEAIUPxGwHCLuPtEhRhru3n.jpg","vote_average":0}}},"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8w44hUnFZIuK6plchcGzcW2mPU4.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8w44hUnFZIuK6plchcGzcW2mPU4.jpg","air_date":"2021-12-06","episode_count":16,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Eu sei o que você fez no verão passado","overview":"Como alunos do ensino médio, Kook Yeon-su e Choi Ung dão uma olhada em suas vidas em uma equipe de documentários. Dez anos depois, eles seguiram caminhos separados.","air_date":"2021-12-06","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/urH1DCGQYaYJm8LpUOlGzIJSX4K.jpg","vote_average":0},"2":{"name":"1792 Dias de Verão","overview":"Yeon-su e Ung se reúnem pela primeira vez em cinco anos quando ela aparece na porta dele com uma proposta de trabalhar juntos em um projeto de arte.","air_date":"2021-12-07","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/yNGkxWLR9ufYcVuMbILr9NJdPD5.jpg","vote_average":0},"3":{"name":"10 Coisas Que Eu Odeio Em Você","overview":"Ansioso para filmar um documentário de acompanhamento, Kim Ji-ung tenta persuadir Yeon-su e Ung. Mas fazê-los concordar revela-se um desafio.","air_date":"2021-12-13","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/vs4CTZ1IV6DokGAoA0EVLlFX60e.jpg","vote_average":0},"4":{"name":"O menino, ou a menina, nós gostamos então","overview":"As brigas de Yeon-su e Ung começam antes mesmo de as câmeras começarem a rodar. Ung se recusa a dignificar uma acusação de plágio irritante com uma resposta.","air_date":"2021-12-14","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/1PVBsg6tk82wdNAoQYS5ktulcbx.jpg","vote_average":0},"5":{"name":"Um Segredo Que Não Pode Ser Contado","overview":"Ji-ung conta como ele e Ung se tornaram amigos na infância. Yeon-su quer se desculpar com Ung, mas não consegue fazer isso.","air_date":"2021-12-20","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/uk5VFY1kdZ8ga7BPzbVKAypsb7f.jpg","vote_average":0},"6":{"name":"Orgulho e Preconceito","overview":"Ung acorda na manhã do show de desenho ao vivo com algumas lacunas em sua memória. Observando-o no trabalho, Yeon-su vê um lado desconhecido dele.","air_date":"2021-12-21","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/6DO4peboEdTNwmYH2xtkdSrXwiG.jpg","vote_average":0},"7":{"name":"Me pegue se for capaz","overview":"Ung e Yeon-su tentam fugir de ter que se ver, mas acabam no mesmo lugar de qualquer maneira. NJ enfrenta seus cyberbullies.","air_date":"2021-12-27","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/5XxTjsTffNHsWxWb9vYxKyBia26.jpg","vote_average":0},"8":{"name":"Antes do pôr do sol","overview":"Umas férias forçadas começam para Yeon-su e Ung quando a equipe do documentário os prende em um retiro na montanha. Tensões estranhas aumentam entre o par.","air_date":"2021-12-28","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/3CujzN5XjbBlYiu2gfmIaL5q2lG.jpg","vote_average":0},"9":{"name":"Apenas Amigos","overview":"Quando ela não tem notícias de Ung após o retorno do retiro, Yeon-su decide enfrentá-lo. Ele tem uma resposta desorientadora para ela.","air_date":"2022-01-03","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/sbZKf7m6sLo9PCuQaYAChMtpUEV.jpg","vote_average":0},"10":{"name":"Olá, minha alma gêmea","overview":"Com sua mãe de volta à cidade, Ji-ung para de ir para casa para evitar vê-la. Assistir NJ e Ung terem um encontro irrita Yeon-su profundamente.","air_date":"2022-01-04","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/ktDappwbwluL2En6woJoFpNAyVu.jpg","vote_average":0},"11":{"name":"Nossas noites são mais bonitas que seus dias","overview":"Antes do último dia de filmagem, a fofoca sobre Ung e NJ causa um rebuliço. Ji-ung recebe conselhos pontuais sobre a edição de seu documentário.","air_date":"2022-01-10","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/i48L1CneIBS3iFY9JKw4drleii3.jpg","vote_average":0},"12":{"name":"Começar de novo","overview":"Para Ung e Yeon-su, um novo começo é igualmente doce e desajeitado. Quando NJ esbarra em Ji-ung, ela o convida para um drinque.","air_date":"2022-01-11","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/mcWniAXRVTCF2OPAVDDgFWWahMx.jpg","vote_average":0},"13":{"name":"Amor na verdade","overview":"Depois de solicitar conselhos sobre namoro de um colega de trabalho, Yeon-su age fora do personagem na frente de Ung. Enquanto isso, Ji-ung leva algum tempo para si mesmo.","air_date":"2022-01-17","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/sQGVC3D3GXmZpksUtUvQo9Fy857.jpg","vote_average":0},"14":{"name":"A vida é Bela","overview":"Ung faz a Yeon-su uma pergunta difícil de responder. Enquanto Lee Sol-i lida com uma surpresa indesejada em seu bar, Gu Eun-ho passa por ali.","air_date":"2022-01-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/zd7Y0RGgZ5xG3nMXnWFWy41R7NQ.jpg","vote_average":0},"15":{"name":"Três Idiotas","overview":"Um Ji-ung visivelmente deprimido se dedica ao trabalho em vez de ir para casa. Ung espera que Yeon-su venha ver a última noite de sua exposição de arte.","air_date":"2022-01-24","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/gZtPXSewyZUCaV6HN8bIQTtBJSz.jpg","vote_average":0},"16":{"name":"Nosso Amado Verão","overview":"Pronto para perseguir seu próximo sonho, Ung se concentra em estudar no exterior. Quando ele pede a Yeon-su para se juntar a ele, ela tem uma decisão difícil a tomar.","air_date":"2022-01-25","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/sD8MfoPjluK4owATgOppRXWyc5x.jpg","vote_average":0}}}}},
